import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';

const CSVTenderList = () => {
  const [tenders, setTenders] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const tendersPerPage = 10;

  useEffect(() => {
    const fetchCSVData = async () => {
      try {
        const response = await fetch('/path/to/your/tenders.csv');
        const reader = response.body.getReader();
        const result = await reader.read();
        const decoder = new TextDecoder('utf-8');
        const csv = decoder.decode(result.value);
        const results = Papa.parse(csv, { header: true });
        
        setTenders(results.data);
        setTotalPages(Math.ceil(results.data.length / tendersPerPage));
      } catch (error) {
        console.error('Error fetching CSV file:', error);
      }
    };

    fetchCSVData();
  }, []);

  const indexOfLastTender = currentPage * tendersPerPage;
  const indexOfFirstTender = indexOfLastTender - tendersPerPage;
  const currentTenders = tenders.slice(indexOfFirstTender, indexOfLastTender);

  const paginate = (pageNumber) => setCurrentPage(pageNumber);

  return (
    <div className="container mt-5 pt-4">
      <h1 className="my-4 text-center">Latest Tenders</h1>
      <hr />

      <div className="table-responsive">
        {currentTenders.length > 0 ? (
          <table className="table table-bordered table-hover">
            <thead className="table-dark">
              <tr>
                <th scope="col">Title</th>
                <th scope="col">Location</th>
                <th scope="col">Price</th>
                <th scope="col">Closing Date</th>
              </tr>
            </thead>
            <tbody>
              {currentTenders.map((tender, index) => (
                <tr key={index}>
                  <td>
                    <a href={`/tenders/${tender.id}`}>{tender.title}</a>
                  </td>
                  <td>{tender.district}</td>
                  <td>â‚¹{tender.price}</td>
                  <td>{tender.closing_date}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p className="text-center">No tenders found.</p>
        )}
      </div>

      {tenders.length > tendersPerPage && (
        <nav aria-label="Page navigation">
          <ul className="pagination justify-content-center">
            <li className={`page-item ${currentPage === 1 ? 'disabled' : ''}`}>
              <button
                className="page-link"
                onClick={() => paginate(currentPage - 1)}
                aria-label="Previous"
              >
                <span aria-hidden="true">&laquo;</span>
              </button>
            </li>

            {Array.from({ length: totalPages }, (_, i) => i + 1).map((number) => (
              <li key={number} className={`page-item ${number === currentPage ? 'active' : ''}`}>
                <button
                  className="page-link"
                  onClick={() => paginate(number)}
                >
                  {number}
                </button>
              </li>
            ))}

            <li className={`page-item ${currentPage === totalPages ? 'disabled' : ''}`}>
              <button
                className="page-link"
                onClick={() => paginate(currentPage + 1)}
                aria-label="Next"
              >
                <span aria-hidden="true">&raquo;</span>
              </button>
            </li>
          </ul>
        </nav>
      )}
    </div>
  );
};

export default CSVTenderList;
